import { ACTION_TYPES } from "../actions/dCandidate";
const initialState={
    list:[]
}

//action will have type : ACTION_TYPES.FETCH_ALL from actions -> dCandidate.js
//
export const dCandidate  =(state=initialState,action) =>{
    switch (action.type) {
        case ACTION_TYPES.FETCH_ALL:
            
            return {
                ...state,
                list: [...action.payload]
            }
    
        default:
            return state;
    }

}
